function applyMask(maskString) {
  //console.log('inside applymask');
  //console.log(tocArray);
  if(!maskString) return true;
  var maskItems = maskString.split('-');
  var maskRegexp = /([0-9]+)(s([0-9]+))?(i([0-9]+))?/;
  blacklistArray = [];

  for (var i = 0; i < maskItems.length; i++) {
    var maskItem = maskItems[i];
    if (maskItem == '') continue;
    var header = maskItem.replace(maskRegexp, '$1');
    var section = maskItem.replace(maskRegexp, '$3');
    var item = maskItem.replace(maskRegexp, '$5');

    // whole header blacklisted. e.g. REST APIs
    if (!section) {
      if(tocArray[header] !== undefined) {
        blacklistArray.push(tocArray[header]['id']);
      }
      continue;
    }

    // subsection blacklisted. e.g. Non Credit Card
    if (!item) {
      if(tocArray[header] !== undefined && tocArray[header]['children'][section] !== undefined) {
        blacklistArray.push(tocArray[header]['children'][section]['id']);
      }
      continue;
    }

    // only item blacklisted. e.g. giropay
    if(tocArray[header] !== undefined && tocArray[header]['children'][section] !== undefined && tocArray[header]['children'][section]['children'][item] !== undefined) {
      blacklistArray.push(tocArray[header]['children'][section]['children'][item]['id']);
    }
  } // end for maskItems

  for (var i = 0; i < blacklistArray.length; i++) {
    if(editorMode) {
      //<li class="tocify-item" data-unique="_wirecard_payment_page"
      //var generatedTocItem = $('#generated-toc li.tocify-item[data-unique="' + blacklistArray[i] + '"]');
      //generatedTocItem.next('ul.tocify-subheader').hide();
      //generatedTocItem.hide();
      $('#content #' + blacklistArray[i]).parent().hide();
    }
    else {
      console.log('blacklist item id: ' + blacklistArray[i]);
      $('#generated-toc li[data-unique="' + blacklistArray[i] + '"] a').parent().remove();
      $('#' + blacklistArray[i]).parent().remove();
    }
  }
}

